import { configureStore } from "@reduxjs/toolkit"
import { dataPizzaReducers,dataSushiReducers }  from "../features/dataSlice"

export const store = configureStore({
    reducer: {
        pizza: dataPizzaReducers,
        sushi: dataSushiReducers
    }
})
